import React from "react";
import Box from '@material-ui/core/Box';
import { makeStyles } from '@material-ui/core/styles';
import Image from '../assets/funnyCat.png';
import Button from '@material-ui/core/Button';
const useStyles = makeStyles(() => ({
  container: {
    backgroundImage: `url(${Image})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    height: '100vh',
    width: '100%',
    position: "absolute",
  },
  welcomeUserBox: {
    width: 250,
    height: 100,
    margin: 40,
    border: '1px solid rgba(255, 255, 255, 0.4)',
    borderRadius: '15px',
    backdropFilter: 'blur(5px)',
    background: 'radial-gradient(at 50% 0%, rgba(0,0,0,0), rgba(255,255,255,0.3))',
    boxShadow: '10px 10px 30px rgba(0,0,0,0.5)'
  }
}));


const LoggedIn = () => {
  const classes = useStyles()

  return (
    <Box className={classes.container}>
      <Box className={classes.welcomeUserBox} justifyContent='center' >

        <Grid container spacing={1} alignItems="center" justify="center" >
          <h5 style={{ textAlign: 'center', fontFamily: "monospace", fontSize: '1rem'}}>Silver Bullet<br/>Welcome<br/>{"Andrew"}</h5>
        </Grid>
        <Grid container spacing={1} alignItems="flex-end" justify="center">
          <Grid item>
            <AccountCircle />
          </Grid>
          <Grid item>
            <TextField id="input-with-icon-grid-one" label="Username" onChange={event => setUsername(event.target.value)} />
          </Grid>
        </Grid>

      </Box>
    </Box>
  )
}

export default LoggedIn
